import React from "react";
import MainLayout from "./components/layout/MainLayout";
import { BrowserRouter } from "react-router-dom";
import Alerts from "./components/layout/Alerts";

function App() {
  return (
    <BrowserRouter>
      <Alerts/>
      <MainLayout />
    </BrowserRouter>
  );
}

export default App;
